//***FILE 618 is from Pergentino Arias and contains a package of    *   FILE 618
//*           programs to encrypt and decrypt your data using       *   FILE 618
//*           IBM's ICSF Cryptographic Services Facility.           *   FILE 618
//*                                                                 *   FILE 618
//*           email:  "Pergentino Arias" <pergen@mixmail.com>       *   FILE 618
//*                                                                 *   FILE 618
//*        -  -  -  -  -  -  -  -  -  -  -  -  -  -  -  -  -        *   FILE 618
//*                                                                 *   FILE 618
//*     Package Description:                                        *   FILE 618
//*                                                                 *   FILE 618
//*     Here is a little application that calls the                 *   FILE 618
//*     CRYPTOGRAPHIC ICSF API'S.                                   *   FILE 618
//*                                                                 *   FILE 618
//*     All the programs are in REXX.                               *   FILE 618
//*                                                                 *   FILE 618
//*     You need access to keys and to the ICSF.                    *   FILE 618
//*                                                                 *   FILE 618
//*     The programs are in xmit format in member XEXEC.            *   FILE 618
//*     The panels are in xmit format in member XPLIB.              *   FILE 618
//*     The messages are in xmit format in member XMLIB.            *   FILE 618
//*                                                                 *   FILE 618
//*     You only have to start with the REXX PCSF and follow        *   FILE 618
//*     the panels.                                                 *   FILE 618
//*                                                                 *   FILE 618
//*     Note: You have to put your CKDS and your PKDS in            *   FILE 618
//*           program PCSF and all the application works with       *   FILE 618
//*           your files.                                           *   FILE 618
//*                                                                 *   FILE 618
//*     - - - - - - - - - - - - - - - - - - - - - - - - - - - -     *   FILE 618
//*                                                                 *   FILE 618
//*     In addition to this, there are other programs too.          *   FILE 618
//*                                                                 *   FILE 618
//*        In order to create asymetric keys, I put several         *   FILE 618
//*        keys RSA in the members:                                 *   FILE 618
//*                   RSA11024                                      *   FILE 618
//*                   RSA1512  ---> see this first                  *   FILE 618
//*                   RSA21024                                      *   FILE 618
//*                   RSA31024                                      *   FILE 618
//*                   RSA41024                                      *   FILE 618
//*                   RSA51024                                      *   FILE 618
//*                   RSA61024                                      *   FILE 618
//*                   RSA71024                                      *   FILE 618
//*                   RSA81024                                      *   FILE 618
//*                   RSA91024                                      *   FILE 618
//*        This keys are in assembler format for use with a         *   FILE 618
//*        program that put them in the PKDS.  You can use          *   FILE 618
//*        program RSACREA changing the member that use to put      *   FILE 618
//*        the key in the PKDS, and the key label, which is         *   FILE 618
//*        RSAPRU.                                                  *   FILE 618
//*                                                                 *   FILE 618
//*        Other programs                                           *   FILE 618
//*                                                                 *   FILE 618
//*        1   Generate random numbers                              *   FILE 618
//*            COBOL example: randomc                               *   FILE 618
//*            ASML example:  randoma                               *   FILE 618
//*                                                                 *   FILE 618
//*        2   Create symmetric keys using API   KEY GENERATE       *   FILE 618
//*            The program in COBOL:   DESCRECB                     *   FILE 618
//*            The program in ASM:     DESCREAS                     *   FILE 618
//*            With the JCL:           CREASIM                      *   FILE 618
//*                                                                 *   FILE 618
//*        3   Create symetric keys using RANDOM GENERATOR and      *   FILE 618
//*            IMPORT                                               *   FILE 618
//*            The program in COBOL:   DESRANCB                     *   FILE 618
//*            The program in ASM:     DESRANAS                     *   FILE 618
//*                                                                 *   FILE 618
//*        4   Signatures                                           *   FILE 618
//*            5.1    RSADSS1 creates the key RSADSS for            *   FILE 618
//*                   signatures.                                   *   FILE 618
//*                   RSADSS2 makes a signature from a text and     *   FILE 618
//*                   verifies it.                                  *   FILE 618
//*                                                                 *   FILE 618
//*     You can compile all the Assembler programs using the        *   FILE 618
//*     proc ASMCOMP.                                               *   FILE 618
//*     You can compile all the COBOL programs using the proc       *   FILE 618
//*     COBCOMP.                                                    *   FILE 618
//*                                                                 *   FILE 618

ASMCOMP.text:
//SIST19@  JOB (0),' ',CLASS=C,MSGCLASS=C,NOTIFY=&SYSUID
//*---------------------------------------------------------------------
//*
//*  COMPILE ALL THE ASSEMBLER PROGRAMS IN THIS LIBRARY
//*
//*---------------------------------------------------------------------
//ASMLINK PROC LIB1='SIST19.CRYP.EXEC',      -> SOURCE LIB
//             LIB2='SISSHR.SIST19.LOAD',    -> LOAD LIB
//             CRYP='CSF.SCSFMOD0'           -> CRYPTO LIB
//*---------------------------------------------------------------------
//C        EXEC PGM=ASMA90,PARM=(OBJ,LIST)
//SYSLIB   DD  DSN=SYS1.MACLIB,DISP=SHR
//         DD  DSN=SYS1.MODGEN,DISP=SHR
//         DD  DSN=SISSHR.SIST19.EXEC,DISP=SHR
//         DD  DSN=&LIB1,DISP=SHR
//SYSUT1   DD  UNIT=SYSDA,SPACE=(TRK,(10,5))
//SYSPUNCH DD  SYSOUT=B,DCB=(BLKSIZE=800),SPACE=(CYL,(1,1,0))
//SYSPRINT DD  SYSOUT=*
//SYSLIN   DD  DISP=(,PASS),UNIT=VIO,SPACE=(TRK,(5,5)),
//             DCB=(BLKSIZE=400),DSN=&&LOADSET
//SYSIN    DD  DSN=&LIB1(&PROG),DISP=SHR
//*--------------------------------------------------------------
//L        EXEC PGM=IEWL,REGION=1M,COND=(8,LT,C),
//             PARM='XREF,LET,LIST,MAP,CALL'
//SYSLIN   DD  DSN=&&LOADSET,DISP=(OLD,DELETE)
//         DD  DDNAME=SYSIN
//SYSLMOD  DD  DSN=&LIB2(&PROG),DISP=SHR
//SYSUT1   DD  UNIT=SYSDA,SPACE=(TRK,(5,5))
//SYSLIB   DD  DSN=&CRYP,DISP=SHR         FOR CRYPTOGRAPHY
//SYSPRINT DD  SYSOUT=*
//         PEND
//*--------------------------------------------------------------
//RANDOMA  EXEC ASMLINK,PROG='RANDOMA'
//RSACREA  EXEC ASMLINK,PROG='RSACREA'
//DESCREAS EXEC ASMLINK,PROG='DESCREAS'
//DESRANAS EXEC ASMLINK,PROG='DESRANAS'
//RSADSS1  EXEC ASMLINK,PROG='RSADSS1'
//RSADSS2  EXEC ASMLINK,PROG='RSADSS2'

COBCOMP.text:
//SIST19@  JOB (0),' ',CLASS=C,MSGCLASS=C,NOTIFY=&SYSUID
//*---------------------------------------------------------------------
//*
//*  COMPILE ALL THE COBOL PROGRAMS IN THIS LIBRARY
//*
//*---------------------------------------------------------------------
//COBLINK PROC LIB1='SIST19.CRYP.EXEC',       -> SOURCE LIB
//             LIB2='SISSHR.SIST19.LOAD',     -> LOAD LIB
//             CRYP='CSF.SCSFMOD0'            -> CRYPTO LIB
//*---------------------------------------------------------------------
//C        EXEC PGM=IGYCRCTL,REGION=2M
//STEPLIB  DD DSN=IGY.V2R1M0.SIGYCOMP,DISP=SHR
//SYSLIB   DD DSN=&LIB1,DISP=SHR
//SYSPRINT DD SYSOUT=*
//SYSLIN   DD  DSNAME=&&LOADSET,UNIT=3390,DISP=(MOD,PASS),
//             SPACE=(TRK,(15,15))
//SYSUT1   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT2   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT3   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT4   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT5   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT6   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUT7   DD UNIT=SYSDA,SPACE=(TRK,(15,15))
//SYSUDUMP DD DUMMY
//SYSIN    DD  DSN=&LIB1(&PROG),DISP=SHR
//*--------------------------------------------------------------
//L        EXEC PGM=IEWL,PARM=(LIST,XREF,LET,MAP),COND=(5,LT,C),
//            REGION=2M
//SYSLMOD  DD DSN=&LIB2(&PROG),DISP=SHR
//SYSLIB   DD DSN=&CRYP,DISP=SHR           CRYPTOGRAPHIC
//         DD DSN=CEE.SCEELKED,DISP=SHR
//         DD DSN=SYS1.COB2LIB,DISP=SHR
//         DD DSN=&LIB1,DISP=SHR
//SYSUT1   DD UNIT=3390,SPACE=(TRK,(15,15))
//SYSPRINT DD SYSOUT=*
//SYSLIN   DD DSN=&&LOADSET,DISP=(OLD,DELETE)
//         DD DDNAME=SYSIN
//         PEND
//*--------------------------------------------------------------
//RANDOMC  EXEC COBLINK,PROG=RANDOMC
//DESCRECB EXEC COBLINK,PROG=DESCRECB
//DESRANCB EXEC COBLINK,PROG=DESRANCB

CREASIM.text:
//SIST19K JOB CLASS=C,MSGCLASS=C,NOTIFY=&SYSUID
//*-----------------------------------------------------------------
//*
//*   CHANGE "CSF.SCSFCKDS" BY YOUR CKDS
//*
//*-----------------------------------------------------------------
//DELETE   EXEC PGM=CSFKGUP,PARM=('SSM')
//CSFCKDS  DD DSN=CSF.SCSFCKDS,DISP=OLD
//CSFDIAG  DD SYSOUT=*,DCB=(LRECL=133,RECFM=FBA,DSORG=PS)
//CSFKEYS  DD SYSOUT=*,DCB=(LRECL=208,RECFM=FB,DSORG=PS)
//CSFSTMNT DD SYSOUT=*,DCB=(LRECL=80,RECFM=FB,DSORG=PS)
//CSFIN    DD *
DELETE  TYPE(DATA)    LAB(DESRANAS)
DELETE  TYPE(DATA)    LAB(ASMKEYCREATE)
DELETE  TYPE(DATA)    LAB(DESPRU)
DELETE  TYPE(DATA)    LAB(DESPRU2)
DELETE  TYPE(MAC)     LAB(MACPRU)
DELETE  TYPE(MACVER)  LAB(MACVERPRU)
//*-----------------------------------------------------------------
//CREATE   EXEC PGM=CSFKGUP,PARM=('SSM')
//CSFCKDS  DD DSN=CSF.SCSFCKDS,DISP=OLD
//CSFDIAG  DD SYSOUT=*,DCB=(LRECL=133,RECFM=FBA,DSORG=PS)
//CSFKEYS  DD SYSOUT=*,DCB=(LRECL=208,RECFM=FB,DSORG=PS)
//CSFSTMNT DD SYSOUT=*,DCB=(LRECL=80,RECFM=FB,DSORG=PS)
//CSFIN    DD *
ADD TYPE(DATA),
CLEAR KEY(9158596809158595,6201010101010101,0123456789ABCDEF) DES,
 LAB(DESPRU)
ADD TYPE(DATA) LENGTH(16),
CLEAR DES,
 LAB(DESPRU2)
ADD TYPE(MAC),
CLEAR KEY(0123456789ABCDEF),
 LAB(MACPRU)
ADD TYPE(MACVER),
CLEAR KEY(0123456789ABCDEF),
 LAB(MACVERPRU)
//*--------------------------------------------------------------------
//* REFRES DEL CKDS
//*--------------------------------------------------------------------
//REFRESH  EXEC PGM=CSFEUTIL,PARM='CSF.SCSFCKDS,REFRESH'
//SYSPRINT DD  SYSOUT=*
